"use strict";class CarCl{constructor(make,speed){this.make=make,this.speed=speed}accelerate(){this.speed+=10,console.log(`${this.make} is going at ${this.speed} km/h`)}brake(){this.speed-=5,console.log(`${this.make} is going at ${this.speed} km/h`)}}class EVCl extends CarCl{constructor(make,speed,charge){super(make,speed),this.charge=charge}chargeBattery(chargeTo){this.charge=chargeTo}accelerate(){this.speed+=20,this.charge-=1,console.log(`${this.make} going at ${this.speed} km/h, with a charge of ${this.charge}`)}brake(){console.log(`${this.make} going at ${this.speed-=5} km/h, with a charge of ${this.charge}`)}}const rivian=new EVCl("Rivian",120,23);console.log(rivian);